traffic, sample = c4.rural_traffic(gpd.GeoDataFrame([{'geometry': x} for x in network], crs='3857'), sample_size=20, export_samples=True)
traffic = traffic.to_dict('records')

fig = plt.figure(1, (10, 8))
sub1 = fig.add_subplot(111)
sub1.set_title('Kept roads in red (width=traffic/30), random attraction points in black, sample_size=20', pad=10, family='sans-serif')
sub1.axes.get_xaxis().set_visible(False)
sub1.axes.get_yaxis().set_visible(False)

for t in traffic:
    if t['rural']:
        path = Path(numpy.asarray(t['geometry'].coords)[:, :2])
        sub1.add_patch(PathPatch(path, facecolor="none", edgecolor='red', linewidth=t['traffic']/30))
    else:
        path = Path(numpy.asarray(t['geometry'].coords)[:, :2])
        sub1.add_patch(PathPatch(path, facecolor="none", edgecolor='gray', linewidth=0.1))

for s in sample.geometry:
    coords = s.coords[0]
    sub1.plot(coords[0], coords[1], linestyle="", marker='o', color="black", markersize=5)

sub1.autoscale_view()
plt.show()